/// Quasigroups for the Damm Algorithm,
/// based on http://www.md-software.de/math/DAMM_Quasigruppen.txt
use std::error::Error;
use std::fmt;

pub fn apply<U: Into<usize>>(a: U, b: U, base: Order) -> u8 {
    let a: usize = a.into();
    let b: usize = b.into();
    match base {
        Order::Base4 => BASE4[a][b],
        Order::Base8 => BASE8[a][b],
        Order::Base10 => BASE10[a][b],
        Order::Base12 => BASE12[a][b],
        Order::Base16 => BASE16[a][b],
        Order::Base24 => BASE24[a][b],
        Order::Base26 => BASE26[a][b],
        Order::Base32 => BASE32[a][b],
        Order::Base36 => BASE36[a][b],
        Order::Base40 => BASE40[a][b],
        Order::Base45 => BASE45[a][b],
        Order::Base56 => BASE56[a][b],
        Order::Base58 => BASE58[a][b],
        Order::Base62 => BASE62[a][b],
        Order::Base64 => BASE64[a][b],
    }
}

#[derive(Clone, Copy)]
pub enum Order {
    Base4,
    Base8,
    Base10,
    Base12,
    Base16,
    Base24,
    Base26,
    Base32,
    Base36,
    Base40,
    Base45,
    Base56,
    Base58,
    Base62,
    Base64,
}

impl Order {
    fn alphabet_length(self) -> u8 {
        match self {
            Order::Base4 => 4,
            Order::Base8 => 8,
            Order::Base10 => 10,
            Order::Base12 => 12,
            Order::Base16 => 16,
            Order::Base24 => 24,
            Order::Base26 => 26,
            Order::Base32 => 32,
            Order::Base36 => 36,
            Order::Base40 => 40,
            Order::Base45 => 45,
            Order::Base56 => 56,
            Order::Base58 => 58,
            Order::Base62 => 62,
            Order::Base64 => 64,
        }
    }
}

impl TryFrom<usize> for Order {
    type Error = UnimplementedBaseError;

    fn try_from(value: usize) -> Result<Self, Self::Error> {
        match value {
            4 => Ok(Order::Base4),
            8 => Ok(Order::Base8),
            10 => Ok(Order::Base10),
            12 => Ok(Order::Base12),
            16 => Ok(Order::Base16),
            24 => Ok(Order::Base24),
            26 => Ok(Order::Base26),
            32 => Ok(Order::Base32),
            36 => Ok(Order::Base36),
            40 => Ok(Order::Base40),
            45 => Ok(Order::Base45),
            56 => Ok(Order::Base56),
            58 => Ok(Order::Base58),
            62 => Ok(Order::Base62),
            64 => Ok(Order::Base64),
            v => Err(UnimplementedBaseError(v)),
        }
    }
}

#[derive(Debug)]
pub struct UnimplementedBaseError(usize);

impl fmt::Display for UnimplementedBaseError {
    fn fmt(&self, f: &mut fmt::Formatter<'_>) -> fmt::Result {
        write!(f, "Provided base ({}) is not implemented", self.0)
    }
}

impl Error for UnimplementedBaseError {}

