    /// From wikipedia:
    ///
    /// A quasigroup (Q, ) is a non-empty set Q with a binary operation 
    /// (that is, a magma, indicating that a quasigroup has to satisfy closure property),
    /// obeying the Latin square property.
    /// This states that, for each a and b in Q,
    /// there exist unique elements x and y in Q such that both
    ///
    /// a * x = b,
    ///
    /// y * a = b
    ///
    /// hold.
    fn is_quasigroup<const N: usize>(f: [[u8; N]; N]) -> bool {
        let mut rhs_buf: [bool; N];
        for a in 0..N {
            // Test a * x = b for all b
            rhs_buf = [false; N];
            for x in 0..N {
                rhs_buf[f[a][x] as usize] = true;
            }
            if !rhs_buf.iter().all(|b| *b) {
                return false;
            }

            // Test y * a = b for all b
            rhs_buf = [false; N];
            for y in 0..N {
                rhs_buf[f[y][a] as usize] = true;
            }
            if !rhs_buf.iter().all(|b| *b) {
                return false;
            }
        }
        true
    }

    /// From wikipedia:
    ///
    /// A quasigroup (Q, ) is called weakly totally anti-symmetric if for all
    /// c, x, y  Q, the following implication holds.
    ///
    /// (c  x)  y = (c  y)  x implies that x = y
    fn is_weakly_totally_anti_symmetric<const N: usize>(f: [[u8; N]; N]) -> bool {
        for c in 0..N {
            for x in 0..N {
                for y in 0..N {
                    if (f[f[c][x] as usize][y] == f[f[c][y] as usize][x]) && (x != y) {
                        return false;
                    }
                }
            }
        }
        true
    }

    use super::*;

    #[test]
    fn base4_is_weakly_totally_antisymmetric_quasigroup() {
        assert!(is_quasigroup(BASE4));
        assert!(is_weakly_totally_anti_symmetric(BASE4));
    }

